import java.util.*;
public class Color {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Scanner sc = new Scanner(System.in);
		System.out.println("Enter alphabet what know color: ");
		String c = sc.nextLine().toUpperCase();
		switch (c)
		{
		case "A":
			System.out.println("Azure");
			break;
		case "B":
			System.out.println("Blue");
			break;
		case "C":
			System.out.println("Chocolate");
			break;
		case "D":
			System.out.println("Daffodil");
			break;
		case "E":
			System.out.println("Evergreen");
			break;
		case "F":
			System.out.println("Flame");
			break;
		case "G":
			System.out.println("Gold");
			break;
		case "H":
			System.out.println("Honeydew");
			break;
		case "I":
			System.out.println("Indigo");
			break;
		case "J":
			System.out.println("Jet Black");
			break;
		case "K":
			System.out.println("Khaki");
			break;
		case "L":
			System.out.println("Lavender");
			break;
		case "M":
			System.out.println("Magenta");
			break;
		case "N":
			System.out.println("Navy Blue");
			break;
		case "O":
			System.out.println("Orange");
			break;
		case "P":
			System.out.println("Peach");
			break;
		case "Q":
			System.out.println("Queen Blue");
			break;
		case "R":
			System.out.println("Red");
			break;
		case "S":
			System.out.println("Silver");
			break;
		case "T":
			System.out.println("Tan");
			break;
		case "U":
			System.out.println("Ultramarine");
			break;
		case "V":
			System.out.println("Violet");
			break;
		case "W":
			System.out.println("White");
			break;
		case "X":
			System.out.println("Xanadu");
			break;
		case "Y":
			System.out.println("Yellow");
			break;
		case "Z":
			System.out.println("Zaffre");
			break;
		default:
			System.out.println("Invalid character");
			
		}

	}

}
